import React from 'react';
import Navbar from './navbar'

class Header extends React.Component{
    constructor(){
        super();
        this.props = [
            {profile: <p><a className="nav-link link-light h3" href="http:localhost:3000">Мои заказы</a></p>},
            {orders: <p><a className="nav-link link-light h3" href="http:localhost:3000">Мои заказы</a></p>},
            {qanda: <p><a className="nav-link link-light h3" href="http:localhost:3000">Мои заказы</a></p>}
        ]
    }
    render(){
        return(<Navbar {...this.props}/>);
    }
}
export default Header;
